    return <div className="workcontainer">
        <h1 className="projectheading">Projects</h1>
        <div className="project-container">
            <div className="project-card">
               {WorkCard.map((val,ind) =>{
                return(
                    <WorkCard 
                    key={ind}
                    imgsrc={val.imgsrc}
                    title={val.title}
                    text={val.text}
                    view={val.view}
                    />
                );
               })}
            </div>
        </div>
    </div>
}
export default Work;
